var __index = {"config":{"lang":["en"],"separator":"[\\s\\u200b\\-]","pipeline":["stemmer"]},"docs":[{"location":"index.html","title":"\u524d\u8a00","text":"<p>\u200b\u5728\u200b\u521a\u200b\u5f00\u59cb\u200b\u5b66\u4e60\u200b Unix/Linux \u200b\u7f16\u7a0b\u200b\u65f6\u200b\uff0c\u200b\u9700\u8981\u200b\u4e00\u672c\u200b\u5165\u95e8\u200b\u8bfb\u7269\u200b\u4e86\u89e3\u200b Unix/Linux \u200b\u7f16\u7a0b\u200b\u3002\u200b\u50cf\u200b\u300aAdvanced Programming in the Unix Environment\u300b\u3001\u300aThe Linux Programming Interface\u300b\u200b\u4ee5\u53ca\u200b\u300aUnix NetWork Programming\u300b\u200b\u8fd9\u4e9b\u200b\u7ecf\u5178\u200b\u4e66\u7c4d\u200b\u7684\u200b\u5185\u5bb9\u200b\u5bf9\u4e8e\u200b\u521d\u5b66\u8005\u200b\u6765\u8bf4\u200b\u592a\u591a\u592a\u6742\u200b\uff0c\u200b\u5f88\u200b\u5bb9\u6613\u200b\u529d\u9000\u200b\u521d\u5b66\u8005\u200b\uff0c\u200b\u4e5f\u200b\u4e0d\u200b\u63a8\u8350\u200b\u521d\u5b66\u8005\u200b\u901a\u8fc7\u200b\u9605\u8bfb\u200b\u8fd9\u4e9b\u200b\u4e66\u7c4d\u200b\u5b66\u4e60\u200b\u3002</p> <p>\u200b\u673a\u7f18\u5de7\u5408\u200b\u4e0b\u200b\uff0c\u200b\u4e86\u89e3\u200b\u4e86\u200b\u300aUnix \u200b\u7f16\u7a0b\u200b\u5b9e\u8df5\u200b\u6559\u7a0b\u200b\u300b\u200b\u8fd9\u200b\u672c\u4e66\u200b\uff0c\u200b\u8fd9\u672c\u200b\u5173\u4e8e\u200b Unix \u200b\u7f16\u7a0b\u200b\u5165\u95e8\u200b\u7684\u200b\u4e66\u200b\uff0c\u200b\u96be\u5ea6\u200b\u4e0d\u9ad8\u200b\uff0c\u200b\u5faa\u5e8f\u6e10\u8fdb\u200b\uff0c\u200b\u8bfb\u200b\u8d77\u6765\u200b\u5f88\u200b\u8f7b\u677e\u200b\uff0c\u200b\u4e5f\u200b\u6709\u200b\u4e0d\u5c11\u200b\u7684\u200b\u6536\u83b7\u200b\uff0c\u200b\u6bd4\u8f83\u200b\u7cfb\u7edf\u5730\u200b\u4e86\u89e3\u200b(\u200b\u53ea\u80fd\u200b\u8bf4\u200b\u662f\u200b\u4e86\u89e3\u200b)\u200b\u4e86\u200b\u4e00\u904d\u200b Unix \u200b\u7f16\u7a0b\u200b\u57fa\u7840\u200b\u3002\u200b\u4f46\u662f\u200b\uff0c\u200b\u8fd9\u200b\u672c\u4e66\u200b\u6700\u5927\u200b\u7684\u200b\u95ee\u9898\u200b\u5728\u4e8e\u200b\u8be5\u4e66\u200b\u51fa\u7248\u200b\u65f6\u95f4\u200b\u8f83\u200b\u65e9\u200b\uff0c\u200b\u4e66\u4e2d\u200b\u5f88\u591a\u200b\u5185\u5bb9\u200b\u73b0\u5728\u200b\u90fd\u200b\u5df2\u7ecf\u200b\u6dd8\u6c70\u200b\uff0c\u200b\u56e0\u6b64\u200b\u8bfb\u200b\u7684\u200b\u65f6\u5019\u200b\u52a1\u5fc5\u200b\u81ea\u884c\u200b man \u200b\u67e5\u9605\u200b\u624b\u518c\u200b\u3002</p> <p>\u200b\u8fd9\u200b\u672c\u4e66\u200b\u901a\u8fc7\u200b\u4e09\u4e2a\u200b\u6b65\u9aa4\u200b\u6765\u200b\u4ecb\u7ecd\u200b\u6bcf\u200b\u4e00\u4e2a\u200b\u91cd\u8981\u200b\u77e5\u8bc6\u70b9\u200b\uff1a</p> <ol> <li>What does it do?</li> <li>How does it work?</li> <li>Let's write our own version</li> </ol> <p>\u200b\u8ba9\u200b\u6bcf\u200b\u4e00\u4e2a\u200b\u8bfb\u8005\u200b\u5b8c\u5168\u200b\u5438\u6536\u200b\u672c\u4e66\u200b\u7684\u200b\u6240\u6709\u200b\u77e5\u8bc6\u70b9\u200b\uff0c\u200b\u662f\u200b\u4e00\u672c\u200b\u503c\u5f97\u200b\u63a8\u8350\u200b\u7684\u200b\u8bfb\u7269\u200b\u3002</p> <p>\u200b\u7531\u4e8e\u200b\u73b0\u5728\u200b\u7f51\u4e0a\u200b\u627e\u5230\u200b\u7684\u200b\u7535\u5b50\u4e66\u7c4d\u200b\u6216\u200b\u4e70\u200b\u7684\u200b\u7eb8\u8d28\u200b\u4e66\u7c4d\u200b\u90fd\u200b\u4e0d\u591f\u200b\u6e05\u6670\u200b\uff0c\u200b\u5e76\u4e14\u200b\u5b57\u4f53\u200b\u662f\u200b\u503e\u659c\u200b\u7684\u200b\uff0c\u200b\u9605\u8bfb\u200b\u4f53\u9a8c\u200b\u5927\u6253\u6298\u6263\u200b\u3002\u200b\u672c\u4eba\u200b\u5229\u7528\u200b\u95f2\u6687\u200b\u65f6\u95f4\u200b\uff0c\u200b\u5c06\u200b\u5176\u200b\u7f16\u8f91\u200b\u6210\u200b\u6b64\u4e66\u200b\uff0c\u200b\u4f9b\u200b\u5927\u5bb6\u200b\u9605\u8bfb\u200b\u4f7f\u7528\u200b\u3002</p> <p>\u200b\u9605\u8bfb\u200b\u63d0\u9192\u200b</p> <p>\u200b\u5728\u200b\u7f16\u8f91\u200b\u7684\u200b\u65f6\u5019\u200b\uff0c\u200b\u90e8\u5206\u200b\u5df2\u200b\u6dd8\u6c70\u200b\u7684\u200b\u77e5\u8bc6\u200b\u5185\u5bb9\u200b\uff0c\u200b\u5728\u200b\u5b9e\u73b0\u200b\u4ee3\u7801\u200b\u4e2d\u200b\u53ef\u80fd\u200b\u4f1a\u200b\u4e0e\u200b\u4e66\u200b\u4e2d\u200b\u6709\u6240\u4e0d\u540c\u200b\uff0c\u200b\u66ff\u6362\u200b\u4e3a\u200b\u76ee\u524d\u200b\u8f83\u200b\u65b0\u200b\u7684\u200b\u77e5\u8bc6\u200b\u5185\u5bb9\u200b\uff0c\u200b\u8bfb\u8005\u200b\u4eec\u200b\u8bf7\u200b\u81ea\u884c\u200b\u9274\u522b\u200b\u3002</p> <p>\u200b\u4e2a\u4eba\u200b\u80fd\u529b\u200b\u6709\u9650\u200b\uff0c\u200b\u96be\u514d\u4f1a\u200b\u6709\u200b\u7f16\u8f91\u200b\u9519\u8bef\u200b\u6216\u200b\u77e5\u8bc6\u200b\u5185\u5bb9\u200b\u4f7f\u7528\u200b\u9519\u8bef\u200b\u7684\u200b\u5730\u65b9\u200b\uff0c\u200b\u5e0c\u671b\u200b\u8bfb\u8005\u200b\u4eec\u200b\u80fd\u591f\u200b\u6307\u51fa\u200b\uff0c\u200b\u672c\u4eba\u200b\u4f1a\u200b\u53ca\u65f6\u200b\u4fee\u6b63\u200b\uff0c\u200b\u4ee5\u514d\u200b\u5f71\u54cd\u200b\u8bfb\u8005\u200b\u4eec\u200b\u7684\u200b\u9605\u8bfb\u200b\u4f53\u9a8c\u200b\u3002</p>"},{"location":"index.html#\u6253\u8d4f\u8d5e\u52a9","title":"\u6253\u8d4f\u200b\u8d5e\u52a9","text":"<p>\u200b\u5236\u4f5c\u200b\u4e0d\u6613\u200b\uff0c\u200b\u611f\u8c22\u200b\u652f\u6301\u200b\u3002</p> \u200b\u652f\u4ed8\u5b9d\u200b \u200b\u5fae\u4fe1"}]}